import { useRouter } from 'next/router'
import styles from '../../styles/projectdetail.module.sass'
import projects from '../../data/projects.json'

const projectsList = projects.projects;

const Project = (props) => {
    const router = useRouter()
    const { pid } = router.query
console.log("pid" + pid)
console.log("props", props);

  const { params } = props.match;
  const projectdetail = projectsList.find(project => {
    return project.id === params.id;
  });
    if (!projectdetail) {
        return <div>Loading</div>;
      }
      return (
        <div className={styles.detail_container}>
          <h2>{projectdetail.title}</h2>
          {projectdetail.image ? (
            <img src={projectdetail.image} alt={projectdetail.title} />
          ) : (
            <div></div>
          )}
          <p>{projectdetail.content}</p>
          {projectdetail.video ? (
            <div className={styles.video_container}>
            <video className={styles.player}
       url={projectdetail.video} width='100%'
      height='100%' /></div>
          ) : (
            <div></div>
          )}
          {projectdetail.presslink ? (
            <a href={projectdetail.presslink}>"Presse"</a>
          ) : (
            <p></p>
          )}
        </div>
      );
}
export default Project;
